The JC01 by OVNS is a super small sleek pod system, featuring a lightweight and compact design, draw-activated firing, and two different pods for alternative vaping methods and materials. The OVNS is very thin and small in shape, holding the pod right above the LED indicator lights. The draw activated firing means that the device can be designed without a need for buttons and can be used in a convenient on-the-go manner.OVNS JC01 Pod System Kit Features: The JC01 comes with two different pods and coil options for various juice options and nicotine levels.

Battery Parameters:

Dimensions: 65mm x 8mm x 40mm.Battery Capacity: 400mAh

CBD.Pod 1 Parameters:

Capacity: 0.8mL
Resistance Range: 1.5 Ohm
Ceramic Coil

E-Liquid.Pod 2 Parameters:

Capacity: 0.7mL
Resistance Range: 2.0 Ohm.
SMART MCU CHIPSET: The MCU with the smart airflow control chipset brings you a better instant inhale experience.

LED INDICATOR LIGHTS:  3 LED Lights - 100-70%
2 LED Lights - 70-30%
1 LED Light - Below 30%.OVNS JC01 Pod System Kit Contents:

1 x JC01 Battery
1 x CBD Ceramic Pod
1 x E-Liquid Pod
1 x USB Charging Cable
1 x User ManualOVNS JC01 Pod System Kit Colors:Silver | Yellow Spots | Green Spots | Black Spots | Gun Metal | White | Orange Spots | Blue Spots | Navy Blue | Black | Blue Purple | Purple | Rose Gold | Red | Tiffany Blue









